"2a777c3d0de969f488290884ecc01184e01d1a8f":"You cannot add/remove main blocks, also you can move them to a desired place in the workspace. Only one block can exist for each step in the workspace.",f4bad39e0da47ce1f413083ec703c9bdb4e821bc:"To start pick a <b>symbol</b> block from markets. Some steps like this one don't have the <b>Next step</b> button, therefore you need to follow the instructions to go to the next step, (in this case picking a symbol from left should lead you to the next step.)",befc05c5b14b4c155cea1552fc019fc100adeddb:"Great! Now add it to the <b>Define Trade</b> block.","25d5b0a626412f2ba48c10ec8a56c9efc62b5a49":"Alright! Now pick a <b>trade type</b> block.",a8ce204c869e6df24277611290801e35b787c870:"OK! Now add it to the symbol you added in the previous step.",d518cd463b95acf6b2b42414c41f19408521cd00:"Very good! It's time to add the options needed by the trade type block, pick a number",e20d6b63e449cc63246eb171e6d4368c060a60f5:"from the Math menu","80f10315585e12fc0dd2f7b7faa8a09a8034b79c":"Click on the number block to edit its value",fc8045d8d70d2ae8c31c79b57623fc59609135e7:"change the value to 5 and add it to the <b>ticks</b> field of the trade type block","6e317f95b71981900a70cb465671f1021bbbf5a8":"OK, Now add all remaining options to the trade type block","282ea251bdfda29ddf988b813e77ebb65c7d6c0d":"That's it, now you have a complete trade block with its options. It's time to define a strategy","857317010a7ce5beb986245e16df89ea1107f2e9":"This is a <b>before purchase</b> block. All the blocks you put in here are run for each and every tick received.","2241114380da23680a3d0c54949ebff29b551107":"You can some basic blocks for ticks/candle analysis and also payout/ask price to check the price before doing purchase.",d807900b7f73755ca95b24429d76f4a2116ca7b9:"We'll now create our strategy by adding a single <b>purchase</b> block. Please pick a purchase block from the toolbox.","49c6a22fd28c88b4442a50b979f47b4d9e92e161":"Now add it to the before purchase block.","4a362e853d0afc9cca5f580cc02999ee0ea12f84":"Nicely Done! The purchase block initiates a purchase defined by its dropdown list, e.g. if your trade type block is of <b>Rise/Fall</b> type you will have <b>Rise</b> and <b>Fall</b> options on the purchase block to select from.",f473d84a07518a15f65f3727eb52c9d5c18a44c2:"A before purchase block consisting of only a purchase block means to purchase as soon as the first tick was received.",b8c5e7eaff26dd923ad6801e07482d40bc20bfc2:"After a purchase was the bot waits till the purchase is completed, and then gives the control to the <b>after purchase</b> block","11b3fa5078b3714d73355fd82e135b7faa84496c":"Same as the before purchase block, the <b>after purchase</b> block can have multiple blocks defining its functionality. The after purchase block defines what to do when the previously purchased contract is finished.",f426f2ed809156b5948eeedb366e176f61f2044c:"A <b>Trade Again</b> block creates a new trade and exits from the after purchase block. Now pick a Trade Again block.","0d4f202c28f60e4ec6e3092ad3c9b4b8420c9f87":"Now add it to the after purchase block","86aa77e65de8324cd6d0b7f9d5b7b74546786185":"Excellent! The <b>Trade Again</b> block starts a new trade immediately after the previous contract is finished, therefore creates an infinite loop which goes on and on until the Trade Again block isn't called e.g. in a logic block which its trade type is unmet.","70c9ae0969c05b75bb0e837567153a3b5ce1d0aa":"OK, this's it. Now we have a working bot which buys a contract after the first tick and then creates another trade which is exactly the same as before.","505f22f919520c4cd40739be12fb611c7d8b15d8":"You can use Ctrl + -/+ to zoom out/in the blocks",f49c79f5e096ac6909e0fc364980583fd20c46b6:"You can choose the account you want by the <b>Account</b> dropdown. If you cannot see the dropdown please login using the <b>Login</b> button above. Please make sure to use Virtual Account tokens for testing.",cd69f8cbfeeb5db3db9743b463